{"operationName":"products","variables":{"productIds":["10021427","10021426","10021625","10021624","10019079","10019206","10019101"]},"query":"query products($productIds: [String]!) {
  products(productIds: $productIds) {
    productId
    name {
      cyrillic
      latin
      __typename
    }
    rating {
      star
      count
      __typename
    }
    media {
      images {
        key
        urls
        __typename
      }
      __typename
    }
    features {
      main {
        name
        value
        __typename
      }
      energyEfficiency {
        name
        value
        __typename
      }
      __typename
    }
    brand {
      name
      __typename
    }
    categories {
      id
      name
      __typename
    }
    __typename
  }
}
"}
